import React from 'react';
import before from '../images/floro-cristina-5107-before.jpg';
import after from '../images/floro-cristina-5107-after.jpg';

const imageChangeOnMouseOver = () => {
  return (
    <div>
      <img src={before} alt=""/>
      <img src={after} alt=""/>
    </div>
  )
}

export default imageChangeOnMouseOver;
